import React from 'react';
import { useParams } from 'react-router-dom';

const Pages = () => {
    let { page } = useParams();
    console.log(page)
    if(page === ''){
        page = 'about'
    }

    return (
        <div className="container">
            <section className="p-5">
                I am pages component. {page}
            </section>
        </div>
    );
}


export default Pages;
